        static void PrintFilter(IEnumerable<CommandInfo> cmd) 
        { 
            foreach (var c in cmd) 
            { 
                Console.WriteLine(c.Alias); 
            } 

            Console.WriteLine("-----------"); 
        } 

        static void PrintLogs(IEnumerable<Log> logs) 
        { 
            foreach (var log in logs) 
            { 
                Console.WriteLine("---------------"); 
                Console.WriteLine(log.Type); 
                Console.WriteLine(log.Title); 
                Console.WriteLine(log.Message); 
                Console.WriteLine(log.StackTrace); 
                Console.WriteLine("---------------"); 
            } 
            RTConsole.Instance.Logger.Clear(); 
        } 
    } 

    public class Vector3 
    { 
        public float x, y, z; 

        public Vector3(float x, float y, float z) 
        { 
            this.x = x; 
            this.y = y; 
            this.z = z; 
        } 

        public override string ToString() 
        { 
            return "(" + x + "," + y + "," + z + ")"; 
        } 
    } 

    public class Vector2 
    { 
        public int x, y; 

        public Vector2(int x, int y) 
        { 
            this.x = x; 
            this.y = y; 
        } 

        public override string ToString() 
        { 
            return "(" + x + "," + y + ")"; 
        } 
    } 

    class Vector3Interpreter : ITypeConverter 
    { 
        public string Regex 
        { 
            get 
            { 
                return @"{(\s*-?[0-9]+(\.[0-9]+)?\s*){3}}"; 
            } 
        } 

        public object ConvertFrom(string match) 
        { 
            var m = System.Text.RegularExpressions.Regex.Match(match, @"(\s*-?[0-9]+(\.[0-9]+)?\s*){3}"); 
            var str = System.Text.RegularExpressions.Regex.Split(m.Value, @"\s+").Where(s => !string.IsNullOrEmpty(s)).Select(s => Convert.ToSingle(s)).ToArray(); 
            return new Vector3(str[0], str[1], str[2]); 
        } 

        public System.Type Type 
        { 
            get 
            { 
                return typeof(Vector3); 
            } 
        } 
    } 

    class Vector2Interpreter : ITypeConverter 
    { 
        public string Regex 
        { 
            get 
            { 
                return @"{(\s*\d+\s*){2}}"; 
            } 
        } 

        public object ConvertFrom(string match) 
        { 
            var m = System.Text.RegularExpressions.Regex.Match(match, @"(\s*\d+\s*){2}"); 
            var str = System.Text.RegularExpressions.Regex.Split(m.Value, @"\s+").Where(s => !string.IsNullOrEmpty(s)).Select(s => Convert.ToInt32(s.Trim())).ToArray(); 
            return new Vector2(str[0], str[1]); 
        } 

        public System.Type Type 
        { 
            get 
            { 
                return typeof(Vector2); 
            } 
        } 
    } 
}
